import { Carousel, Button } from "react-bootstrap";
import { CardGroup, Row, Col } from "react-bootstrap";
import img1 from "../imgs/imglogin.png";

const Blog = () => {
  return (
    <div>
      <div className="container">
        <div>
          <img className="blogImg" src={img1} />
        </div>
        <div className="error">
          <h2>Blog</h2>
        </div>
      </div>
    </div>
  );
};

export default Blog;
